import React from 'react';
import { FaAccusoft, FaAdn, FaAngleLeft } from "react-icons/fa";
import { Link } from "react-router-dom";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function Modules(props){
    return(
        <>
           <div className="card">
                 <img className="card_image" src={props.image} />
                 <div className="Divider_line"></div>
                 <div className="card_body">
                     <h3 className="card_module">{props.module_name}</h3>
                     <h2 className="card_title">{props.title}</h2>
                     <div className="card_info">
                         <div className="time">
                             <FaAccusoft icon="fa-regular fa-coffee" />
                             <div><p className='time_passed'>Temps pass√© : 00:00:00</p></div>
                         </div>
                         <div className='score'>
                             <FaAngleLeft size='1.1rem' style={{marginTop: '.3rem'}} />
                             <div className='score1'><p className='rating'>Score : 0%</p></div>
                         </div>
                     </div>
                     <center><Link to={props.module_page}><button className="card_btn">Button</button></Link></center>
                 </div>
           </div>
        </>
    );
}


export default Modules;
